function draw(w, h) {
	w = w - 30;
	h = h - 25;

	var colors = pv.Colors.category19(),
            lastScale = 1;
        patchListen = function(func) {
            // redirect protovis access to window to the morph
            ProtoVisLayer.redirectWindow = this.renderContext().morphNode;
            return withLayers([ProtoVisLayer], function() {
                return func()
            })
        }.bind(this);
	var vis = new pv.Panel()
	    .width(w)
	    .height(h)
	    .fillStyle("white")
	    .event("mousedown", patchListen(pv.Behavior.pan))
	    .event("mousewheel", 
                pv.Behavior.zoom(5).wrap(function(proceed) {
                    lastScale =this.transform().k
                    proceed()
                })
            );

        var fontSizeFunc = function(d) { 
            return Math.round((1 *  lastScale)) + "px sans-serif" }

	var force = vis.add(pv.Layout.Force)
            .springLength(50)
	    .nodes(this.graph.nodes)
	    .links(this.graph.links);

	var line = force.link.add(pv.Line)
            .lineWidth(2)
            .add(pv.Label)
            .left(function(node,p) {return (
                p.sourceNode.x * 0.6
                + p.targetNode.x * 0.4) }) 
            .top(function(node,p) {return (
                    p.sourceNode.y * 0.6 
                    + p.targetNode.y * 0.4)}) 
            .textAlign("center")       
            .textBaseline("bottom")    
             .font(fontSizeFunc)   
             .textAngle(function(d, p) {
                return Math.atan2(p.targetNode.y - p.sourceNode.y, 
                        p.targetNode.x - p.sourceNode.x)})       
            .text(function(node,link) { 
                return !node.obj || node.obj[link.name] ? "" : link.name })

        line.add(pv.Dot)
            .left(function(node,p) {return (
                p.sourceNode.x * 0.2
                + p.targetNode.x * 0.8) }) 
            .top(function(node,p) {return (
                    p.sourceNode.y * 0.2 
                    + p.targetNode.y * 0.8)}) 
            .angle(function (n,l) {
                return Math.atan2(l.targetNode.y - l.sourceNode.y, l.targetNode.x - l.sourceNode.x) - Math.PI/2;
               })
            .shape("triangle")
            .fillStyle("#999")
            .size(.5);


        var owner = this.owner;
	var nodeDot = force.node.add(pv.Dot)
	    .size(function(d) {
		return (2 * d.linkDegree + 3)})
	    .fillStyle(function(d) {return d.fix ? "brown" : colors(d.group)})
	    .strokeStyle(function() {return this.fillStyle().darker()})
	    .lineWidth(1)
	    .title(function(d) { return d.nodeName})
	    .event("drag", force)
	    .event("mousedown", 
                patchListen(pv.Behavior.drag).wrap(function(proceed, a) {
                owner.setSelection(a)
                return proceed(a)
            }))

	nodeDot.anchor('center')
            .add(pv.Label)
 	    .text(function(d) { return d.nodeName })
 	    .font(fontSizeFunc)

	return vis;
}

