function updateVis() {
    var modules = Global.subNamespaces(true).select(function(ea) {
            return ea.isLoaded() && new WebResource(ea.uri()).exists() }),
        nodes = {},
        links = [];

    // pass 1: create nodes
    modules.forEach(function(m, i) {
        var id = m.namespaceIdentifier;
        nodes[id] = ({
            nodeName: id,
            id: id,
            index: i,
            group: 'group',
            obj: m
        })
    })

    // pass 2: find out about dependencies
    modules.forEach(function(m, i) {
        if (!m.privateRequirements) return;
        var id = m.namespaceIdentifier;
        m.privateRequirements.forEach(function(depM) {
            var depId = depM.namespaceIdentifier;
        links.push({
            name:  '',
            source: i,
            target: nodes[depId].index, 
            value: 1})
        })
    })

    var graph = {
        nodes: Properties.values(nodes).sortBy(function(ea) {return ea.index}), 
        links: links
    };

    this.graph = graph;
    this.get('ProtoVisGraph').setGraphAndRender(this.graph)
}

